const n={docsHtml:`<p><code>@mdui/icons</code> 是一个独立的包，它包含了所有的 Material Icons 图标，每个图标都是一个独立的文件。</p>
<p>你可以按需导入所需的图标，而不必导入整个图标库。因此，使用 <code>@mdui/icons</code> 相比于使用 <a href="https://cdn.w3cbus.com/zh-cn/docs/2/components/icon"><code>&lt;mdui-icon&gt;</code></a> 组件，可以显著减少项目打包后的体积。</p>
<h2 id="installation">
                  <a href="#installation">安装</a>
                </h2>
<p>你需要单独安装该包：</p>
<pre><code class="language-bash">npm install @mdui/icons --save
</code></pre>
<h2 id="usage">
                  <a href="#usage">使用</a>
                </h2>
<p>安装完成后，导入所需的图标文件：</p>
<pre><code class="language-js">import &#39;@mdui/icons/search.js&#39;;
</code></pre>
<p>然后，就可以使用对应的图标组件了：</p>
<pre><code class="language-html">&lt;mdui-icon-search&gt;&lt;/mdui-icon-search&gt;
</code></pre>
`,elements:[]};export{n as default};
